,BF3_ID_P_VNAME_VODAA:"VODNIK AA",BF3_ID_P_VNAME_VODNIK:"GAZ-3937 VODNIK",BF3_ID_P_VNAME_Z11:"Z-11W",BF3_ID_P_VUDESC_AAAA:"Auf dem Turm befinden sich Flugabwehrraketenwerfer, die feindliche Flugzeuge anvisieren und verfolgen.",BF3_ID_P_VUDESC_AAARADAR:l,BF3_ID_P_VUDESC_AAARMOR:f,BF3_ID_P_VUDESC_AAENVG:b,BF3_ID_P_VUDESC_AAPREVENT:p,BF3_ID_P_VUDESC_AAPROX:g,BF3_ID_P_VUDESC_AASMOKE:n,BF3_ID_P_VUDESC_AASTEALTH:"Eine Antireflexschicht an deinem Fahrzeug erschwert es Feinden, dein Fahrzeug zu erfassen und zu verfolgen, und verringert die Zeit, die du feindlicher Sichtung ausgeliefert bist.",BF3_ID_P_VUDESC_AAWPNEFF:t,BF3_ID_P_VUDESC_AAZOOM:m,BF3_ID_P_VUDESC_AHAA:d,BF3_ID_P_VUDESC_AHARADAR:l,BF3_ID_P_VUDESC_AHBRADAR:u,BF3_ID_P_VUDESC_AHECM:a,BF3_ID_P_VUDESC_AHENVG:"Eine Sekundärwaffen-Visierung für den Richtschützen, die mithilfe von Thermaloptik Soldaten und Fahrzeuge zur effizienten Zielidentifizierung hervorhebt.",BF3_ID_P_VUDESC_AHFIREEX:w,BF3_ID_P_VUDESC_AHFLARE:h,BF3_ID_P_VUDESC_AHGHELL:"Vom Helikopterschützen abgefeuerte Lenkflugkörper, die feindliche Landfahrzeuge erfassen und verfolgen und auch per Laser markierte Ziele erfassen können, selbst wenn diese außer Sichtweite sind.",BF3_ID_P_VUDESC_AHGUIDE:"Die Raketen des Piloten sind mit semiaktiven Lenksystemen ausgestattet, die die Präzision und somit auch die Wirkungsreichweite erhöhen.",BF3_ID_P_VUDESC_AHLASER:"An der Nase angebrachte Zielsysteme bestimmen automatisch ein feindliches Fahrzeug in deiner Sichtlinie und markieren es mithilfe von lasergelenkten Waffen für deine Teamkameraden als Ziel.",BF3_ID_P_VUDESC_AHPREV:p,BF3_ID_P_VUDESC_AHPROX:g,BF3_ID_P_VUDESC_AHSTEALTH:s,BF3_ID_P_VUDESC_AHTVG:"Vom Helikopterschützen abgefeuerte TV-gelenkte Flugkörper, die per Direct-Feed-Video geflogen werden.",BF3_ID_P_VUDESC_AHWPNEFF:t,BF3_ID_P_VUDESC_AHZOOM:"Eine Sekundärwaffen-Visierung für den Richtschützen mit bis zu 3x-Vergrößerung.",BF3_ID_P_VUDESC_ARTAA:"Flugabwehrraketen-Eigenschaften werden hinzugefügt, die feindliche Luftfahrzeuge erfassen und verfolgen.",BF3_ID_P_VUDESC_ARTAIRBURST:"Airburst-Raketen werden hinzugefügt, die über dem Boden explodieren und Infanterieschaden maximieren.",BF3_ID_P_VUDESC_ARTDEFENSE:"Setzt entzündlichen Rauch frei, der Spielern im Umfeld Schaden zufügt.",BF3_ID_P_VUDESC_ARTPREVENT:i,BF3_ID_P_VUDESC_ARTPROX:o,BF3_ID_P_VUDESC_ARTSMOKE:n,BF3_ID_P_VUDESC_ARTSTEALTH:r,BF3_ID_P_VUDESC_ARTTOW:"Optisch verfolgte, drahtgelenkte Panzerabwehrrakete.",BF3_ID_P_VUDESC_ARTWPNEFF:t,BF3_ID_P_VUDESC_ARTZOOM:m,BF3_ID_P_VUDESC_IFVAPFSDS:"Panzerbrechende, flügelstabilisierte Treibkäfiggeschosse mit Tracer (APFSDS -T), die mehr direkte Schäden verursachen, aber nicht explosiv sind.",BF3_ID_P_VUDESC_IFVARMOR:f,BF3_ID_P_VUDESC_IFVAT:"Werfer für drahtgelenkte Panzerabwehrgeschosse sind am Turm installiert.",BF3_ID_P_VUDESC_IFVCOAX:x,BF3_ID_P_VUDESC_IFVENVG:"Eine Sekundärwaffen-Visierung mit Thermaloptik, die Soldaten und Fahrzeuge zur effizienten Zielidentifizierung hervorhebt.",BF3_ID_P_VUDESC_IFVHELL:"Werfer für lasergelenkte Panzerabwehrraketen, die feindliche Landfahrzeuge erfassen und verfolgen und per Laser markierte Ziele erfassen können, selbst wenn sie außer Sichtweite sind.",BF3_ID_P_VUDESC_IFVPREVENT:i,BF3_ID_P_VUDESC_IFVPROX:o,BF3_ID_P_VUDESC_IFVSMOKE:n,BF3_ID_P_VUDESC_IFVSTEALTH:r,BF3_ID_P_VUDESC_IFVWPNEFF:t,BF3_ID_P_VUDESC_IFVZOOM:m,BF3_ID_P_VUDESC_JETAA:d,BF3_ID_P_VUDESC_JETARADAR:l,BF3_ID_P_VUDESC_JETAVIONIC:"Ein Computer-Upgrade für erweiterte Waffensysteme, das dir hilft, bei der Nutzung von wärmesuchenden oder lasergelenkten Flugkörpern feindliche Ziele schneller zu erfassen.",BF3_ID_P_VUDESC_JETBRADAR:u,BF3_ID_P_VUDESC_JETECM:a,BF3_ID_P_VUDESC_JETEROCKET:"Unter den Flügeln montierte Raketenwerfer für ungelenkte FFAR-Raketen.",BF3_ID_P_VUDESC_JETFLARE:h,BF3_ID_P_VUDESC_JETMAVER:"Vom Piloten abgefeuerte lasergelenkte Flugkörper, die feindliche Landfahrzeuge erfassen und verfolgen und auch per Laser markierte Ziele erfassen können, selbst wenn diese außer Sichtweite sind.",BF3_ID_P_VUDESC_JETPREV:p,BF3_ID_P_VUDESC_JETPROX:g,BF3_ID_P_VUDESC_JETSTEALTH:s,BF3_ID_P_VUDESC_JETWPNEFF:t,BF3_ID_P_VUDESC_LBTFIREEX:"Versetzt ein ausgefallenes Fahrzeug wieder in den normalen Betriebszustand.",BF3_ID_P_VUDESC_MBTARMOR:f,BF3_ID_P_VUDESC_MBTATGM:"Ein STAFF-Geschoss (Smart Target-Activated Fire and Forget), das feindliche Fahrzeuge erfassen und verfolgen und auch per Laser markierte Ziele erfassen kann, selbst wenn diese außer Sichtweite sind.",BF3_ID_P_VUDESC_MBTCANISTER:"Ein Panzergeschoss, das Tausende Wolframbälle enthält und wie bei einer Schrotflinte durch die Geschützmündung abgefeuert wird.",BF3_ID_P_VUDESC_MBTCITV:"Zugang zu einer dritten Turmposition im Panzer ist verfügbar, von der aus du Ziele per Laser markieren und einen Umfeldscanner nutzen kannst. Du kannst diesen Panzerplatz auch dann einnehmen, wenn andere Spieler den Fahrer- und Schützenplatz besetzen.",BF3_ID_P_VUDESC_MBTCOAX:x,BF3_ID_P_VUDESC_MBTENVG:b,BF3_ID_P_VUDESC_MBTHMG:"Ein schweres Maschinengewehr, das achsparellel zu deiner Hauptwaffe installiert ist.",BF3_ID_P_VUDESC_MBTPREVENT:i,BF3_ID_P_VUDESC_MBTPROX:o,BF3_ID_P_VUDESC_MBTSMOKE:n,BF3_ID_P_VUDESC_MBTSTEALTH:r,BF3_ID_P_VUDESC_MBTWPNEFF:t,BF3_ID_P_VUDESC_MBTZOOM:m,BF3_ID_P_VUDESC_SHAA:d,BF3_ID_P_VUDESC_SHARADAR:l,BF3_ID_P_VUDESC_SHBRADAR:u,BF3_ID_P_VUDESC_SHECM:a,BF3_ID_P_VUDESC_SHFIREEX:w,BF3_ID_P_VUDESC_SHFLARE:h,BF3_ID_P_VUDESC_SHHELL:"Vom Piloten abgefeuerte Lenkflugkörper, die feindliche Landfahrzeuge erfassen und verfolgen und auch per Laser markierte Ziele erfassen können, selbst wenn diese außer Sichtweite sind.",BF3_ID_P_VUDESC_SHPREV:i,BF3_ID_P_VUDESC_SHPROX:o,BF3_ID_P_VUDESC_SHSTEALTH:s,BF3_ID_P_VUDESC_SHWPNEFF:t,BF3_ID_P_VUNAME_AAAA:Kt,BF3_ID_P_VUNAME_AAARADAR:ft,BF3_ID_P_VUNAME_AAARMOR:Y,BF3_ID_P_VUNAME_AAENVG:X,BF3_ID_P_VUNAME_AAPREVENT:q,BF3_ID_P_VUNAME_AAPROX:L,BF3_ID_P_VUNAME_AASMOKE:mt,BF3_ID_P_VUNAME_AASTEALTH:H,BF3_ID_P_VUNAME_AAWPNEFF:A,BF3_ID_P_VUNAME_AAZOOM:V,BF3_ID_P_VUNAME_AH